class City {
    val: number;
    connections: number[];

    constructor(val: number) {
        this.val = val;
        this.connections = [];
    }

    addConnection(connection: City) {
        if (!this.connections.includes(connection.val)) {
            this.connections.push(connection.val);
        }
    }
}


function minReorder(n: number, connections: number[][]): number {
    const cities: Map<number, City> = new Map<number, City>();

    // Build an undirected graph
    for (const connection of connections) {
        const [cityNum1, cityNum2] = connection;
        const city1 = cities.get(cityNum1) || new City(cityNum1);
        const city2 = cities.get(cityNum2) || new City(cityNum2);

        city1.addConnection(city2);
        cities.set(cityNum1, city1);

        city2.addConnection(city1);
        cities.set(cityNum2, city2);
    }

    // console.log(cities);

    const root = cities.get(0);

    return dfs(root, cities, connections);

};

function dfs(city: City | null, cities: Map<number, City>, connections: number[][]): number {
    const cityQueue = [city];

    let change = 0;

    const visited: boolean[] = [];

    while (cityQueue.length > 0) {
        const c = cityQueue.pop();
        visited[c.val] = true;
        // console.log(c.val);

        for (const x of c.connections) {
            if (visited[x] !== true) {
                // console.log(`examining connection between city ${c.val} and city ${x}`);

                const connectedCity = cities.get(x);
                for (let i = 0; i < connections.length; i++) {
                    const y = connections[i];
                    const [y1, y2] = y;
                    if (y1 === c.val && y2 === connectedCity.val) {
                        // console.log(`  need to change [${y1},${y2}]`);
                        change++;
                        connections.splice(i, 1);
                        break;
                    } else {
                        // console.log(`  do NOT need to change [${y1},${y2}]`);
                    }
                }

                cityQueue.push(connectedCity);
            }
        }
    }

    return change;
}


